// ----------- Variables
$font-stack: 'Livvic', sans-serif;

// Primary colors
$midnight-green: #014E56;
$light-coral: #F67E7E;
$white: #FFFFFF;

// Secondary colors
$rapture-blue: #79C8C7;
$police-blue: #2C6269;
$deep-jungle-green: #004047;
$sacramento-state-green: #012F34;
$dark-green: #002529;

$mobile-wrapper: rgba(0,37,41,0.5);
$image-border: #C4FFFE;

// Padding left/right for each screen size
$padding-mobile: 2em;
$padding-tablet: 8em;
$padding-desktop: 13.5em;

sources.scss/shared/_footer.scss:
@use '../variables/' as *;

footer {
    background: $dark-green;
    width: 100%;
    padding: 5.5em 2em;
    position: relative;

    .footer-wrapper {
        display: grid;
        grid-template-columns: minmax(0, 1fr);
        grid-template-rows: repeat(5, auto);
        align-items: center;
        justify-items: center;
        width: 100%;
        max-width: 1110px;
        margin: 0 auto;

        img {
            width: 96px;
            height: 24px;
        }

        nav {
            margin: 2em 0;
            ul {
                display: flex;

                li {
                    &:not(:first-child) {
                        margin: 0 0 0 1em;
                    }
                    a {
                        color: $white;
                        font-size: 1.2rem;
                        font-weight: 600;
                        letter-spacing: .025em;
                        transition: color 600ms ease-in-out;

                        &:hover, &:focus {
                            color: $light-coral;
                        }
                    }
                }
            }
        }

        address {
            color: $white;
            font-size: 1.2rem;
            line-height: 2em;
            font-weight: 600;
            opacity: .6;
            text-align: center;
            margin: 0 0 3em 0; 
            font-style: normal;
            letter-spacing: .025em;
        }

        .social-media {
            margin: 0 0 1.3em 0;

            svg {
                cursor: pointer;

                &:not(:first-child) {
                    margin: 0 0 0 1.3em;
                }

                path {
                    transition: fill 600ms ease-in-out;

                    &:hover, &:focus {
                        fill: $light-coral;
                    }
                }
            }
        }

        small {
            color: $white;
            opacity: .6;
            font-size: 1.2rem;
        }

        .attribution {
            position: absolute;
            bottom: 0;
            text-align: center;
            color: $white;
            opacity: .6;
            font-size: 1rem;
            padding: 0 0 1em 0;

            a {
                color: $white;
                opacity: .6;
                text-decoration: underline;
            }
        }
    }
}

