                font-size: 4rem;
            }
        }

        &:after {
            bottom: 0;
        }
    }

    footer {
        padding: 4em $padding-desktop;

        .footer-wrapper {
            grid-template-rows: repeat(2, auto);
            grid-template-columns: repeat(3, auto);

            img {
                grid-row: 1;
                grid-column: 1;
                width: 160px;
                height: 40px;
            }

            nav {
                grid-row: 2;
                grid-column: 1;

                ul {
                    li {
                        &:not(:first-child) {
                            margin: 0 0 0 3em;
                        }
                        a {
                            font-size: 1.5em;
                        }
                    }
                }
            }

            address {
                grid-row: 1 / 3;
                grid-column: 2;
                text-align: left;
                justify-self: start;
            }

            .social-media {
                grid-row: 1;
                grid-column: 3;
                margin: 0;
                align-self: start;
                justify-self: end;
            }

            small {
                grid-row: 2;
                grid-column: 3;
            }
        }
    }
}

